import React from "react";

function Third() {
  let products = new Array();
  products = [1, 2, 3, 4];
  return (
    <div>
      <center>
        <h2 style={{ marginBottom: "40px" }}>
          New <b>Products</b>
        </h2>
      </center>
      <div className="container-xl d-flex justify-content-center">
        <div className="row">
          {products.map(() => {
            return (
              <div className="card">
                <img
                  src={
                    "https://images.unsplash.com/photo-1542291026-7eec264c27ff?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8OXx8cHJvZHVjdHxlbnwwfHwwfHw%3D&w=1000&q=80"
                  }
                  alt="Denim Jeans"
                  style={{ width: "50%" }}
                  className="col-md-12"
                />
                <h1>Tailored Jeans</h1>
                <p className="price">$19.99</p>
                <p>Some text about the jeans..</p>
                <p>
                  <button className="btn btn-dark" style={{ width: "100%" }}>
                    Add to Cart
                  </button>
                </p>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Third;
